type WakaCodeGrandTotal = {
  grand_total: WakaCodeItem;
  range: WakaCodeRange;
}
type WakaCodeItem = {
  decimal: string;
  digital: string;
  hours: number;
  minutes: number;
  text: string;
  total_seconds: number;
}
type WakaCodeRange = {
  date: string;
  end: string;
  start: string;
  text: string;
  timezone: string;
}
const lerp = (x: number, y: number, a: number) => x * (1 - a) + y * a;
const clamp = (a: number, min = 0, max = 255) => Math.min(max, Math.max(min, a));
export function WakaCodeObjToData(waka: WakaCodeObj) {
  const labels: string[] = []
  const data: number[] = []
  const bgcolor: string[] = []
  const bcolor: string[] = []
  let maxTime = 0
  for (const obj of waka.data) {
    const t = parseFloat(obj.grand_total.decimal)
    data.push(t)
    if (maxTime < t) maxTime = t
    labels.push(obj.range.date.substring(5))
  }
  for (const obj of waka.data) {
    const t = parseFloat(obj.grand_total.decimal)
    const a = clamp(lerp(0, 230, t / maxTime))
    const b = clamp(255 - a)
    bgcolor.push(`rgb(${a},0,${b},0.7)`)
    bcolor.push(`rgb(${a},0,${b},1.0)`)
  }
  return { labels: labels, datasets: Array({ data: data, 
      backgroundColor: (context: ScriptableContext<"line">) => {
        const ctx = context.chart.ctx
        const gradient = ctx.createLinearGradient(0, 0, 0, context.chart.height)
        //console.log(context.dataIndex)
        gradient.addColorStop(0.0, `rgb(255,${context.dataIndex*4  },0  ,1.9)`);
        gradient.addColorStop(1.0, `rgb(0  ,${context.dataIndex*4  },255,1.9)`);
        return gradient;
      },
      borderColor: 'transparent', borderWidth: 0 }) }
}
export function WakaObjToData(waka: WakaLangObj) {
  const labels: string[] = []
  const data: number[] = []
  const color: string[] = []
  for (const obj of waka.data) {
    labels.push(obj.name == "Other" ? "Browsing" : obj.name)
    data.push(obj.percent)
    color.push(obj.color)
  }
  //make bg color half transparent
  return { labels: labels, datasets: Array({ data: data, backgroundColor: color, borderColor: 'transparent', borderWidth: 40, offset: 0, hoverOffset: 80 }) }

}
function interpolateColor(len: number, sred: number, fred: number, sgreen: number, fgreen: number, sblue: number, fblue: number) {
  return Array(len).fill(0).map((e, i) =>
    [
      Math.ceil(sred + (sred >= fred ? -1 : 1) * i * Math.abs(sred - fred) / len),
      Math.ceil(sgreen + (sgreen >= fgreen ? -1 : 1) * i * Math.abs(sgreen - fgreen) / len),
      Math.ceil(sblue + (sblue >= fblue ? -1 : 1) * i * Math.abs(sblue - fblue) / len)
    ]
  ).map((e) => { return 'rgb(' + e[0] + ',' + e[1] + ',' + e[2] + ')' });
}
